function openLink(n,t){for(var u,r=document.getElementsByClassName("city"),i=0;i<r.length;i++)r[i].style.display="none";for(u=document.getElementsByClassName("tablink"),i=0;i<r.length;i++)u[i].className=u[i].className.replace(" w3-red","");document.getElementById(t).style.display="block";n.currentTarget.className+=" w3-red"}